AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_288
    SET payload = LEFT(payload, 1000) + N'|V4-288|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_288;
END
